import React, { useState, useEffect } from 'react';
import styles from './StudentDashboard.module.css';
import { FaBookOpen, FaCalendarAlt, FaChartBar, FaBullhorn, FaUserGraduate } from 'react-icons/fa';

const StudentDashboard = () => {
    const [studentName, setStudentName] = useState('');
    const [studentId, setStudentId] = useState('');
    const [enrolledCourses, setEnrolledCourses] = useState(0);
    const [upcomingEvents, setUpcomingEvents] = useState(0);
    const [completedCourses, setCompletedCourses] = useState(0);
    const [latestAnnouncements, setLatestAnnouncements] = useState([]);

    useEffect(() => {
        const storedStudentName = localStorage.getItem('studentName');
        const storedStudentId = localStorage.getItem('studentId');

        if (storedStudentName && storedStudentId) {
            setStudentName(storedStudentName ? storedStudentName.split(' ')[0] : 'Student');
            setStudentId(storedStudentId);
            // In a real application, you would fetch student-specific data here
            fetchStudentData(storedStudentId);
        }
    }, []);

    const fetchStudentData = async (studentId) => {
        // Replace this with your actual API calls to fetch student data
        // Example:
        // try {
        //     const response = await fetch(`http://localhost:3001/api/students/${studentId}/dashboard-data`);
        //     if (response.ok) {
        //         const data = await response.json();
        //         setEnrolledCourses(data.enrolledCourses);
        //         setUpcomingEvents(data.upcomingEvents);
        //         setCompletedCourses(data.completedCourses);
        //         setLatestAnnouncements(data.latestAnnouncements);
        //     }
        // } catch (error) {
        //     console.error("Error fetching student dashboard data:", error);
        // }

        // Setting some dummy data for now
        setEnrolledCourses(5);
        setUpcomingEvents(2);
        setCompletedCourses(10);
        setLatestAnnouncements([
            { id: 1, title: 'New Course Added: Introduction to AI', date: 'May 3, 2025' },
            { id: 2, title: 'Reminder: Final Exam Schedule Released', date: 'May 2, 2025' },
        ]);
    };

    return (
        <main className={styles.mainContent}>
            <div className={styles.dashboardContainerInner}>
                <header className={styles.header}>
                    <div className={styles.headerWelcome}>
                        Welcome Back, <span className={styles.headerUserName}>{studentName}</span>
                    </div>
                    {/* You might add a search bar or other header elements here */}
                </header>

                <div className={styles.dashboardGrid}>
                    {/* Overview Cards */}
                    <div className={styles.dashboardCard}>
                        <div className={styles.cardIcon}><FaBookOpen /></div>
                        <div className={styles.cardInfo}>
                            <span className={styles.cardTitle}>Enrolled Courses</span>
                            <span className={styles.cardValue}>{enrolledCourses}</span>
                        </div>
                    </div>

                    <div className={styles.dashboardCard}>
                        <div className={styles.cardIcon}><FaCalendarAlt /></div>
                        <div className={styles.cardInfo}>
                            <span className={styles.cardTitle}>Upcoming Events</span>
                            <span className={styles.cardValue}>{upcomingEvents}</span>
                        </div>
                    </div>

                    <div className={styles.dashboardCard}>
                        <div className={styles.cardIcon}><FaUserGraduate /></div>
                        <div className={styles.cardInfo}>
                            <span className={styles.cardTitle}>Completed Courses</span>
                            <span className={styles.cardValue}>{completedCourses}</span>
                        </div>
                    </div>

                    <div className={styles.dashboardCard}>
                        <div className={styles.cardIcon}><FaChartBar /></div>
                        <div className={styles.cardInfo}>
                            <span className={styles.cardTitle}>Your Progress</span>
                            <span className={styles.cardValue}>75%</span> {/* Replace with actual progress */}
                        </div>
                    </div>

                    {/* Announcements Section */}
                    <div className={styles.announcementsCard}>
                        <h2 className={styles.announcementsTitle}><FaBullhorn /> Latest Announcements</h2>
                        <ul className={styles.announcementsList}>
                            {latestAnnouncements.map(announcement => (
                                <li key={announcement.id} className={styles.announcementItem}>
                                    <span className={styles.announcementTitle}>{announcement.title}</span>
                                    <span className={styles.announcementDate}>{announcement.date}</span>
                                </li>
                            ))}
                            {latestAnnouncements.length === 0 && <li className={styles.announcementItem}>No new announcements.</li>}
                        </ul>
                        <button className={styles.viewAllButton}>View All Announcements</button>
                    </div>

                    {/* Add more relevant sections like:
                        - Recent Activity
                        - Quick Links to important pages
                        - Your enrolled clubs
                        - Academic calendar overview
                    */}
                </div>
            </div>
        </main>
    );
};

export default StudentDashboard;
